Text:
@XavierNaxa Sebenarnya kita telah lama terkurung. Daripada Abu Hurairah RA berkata, bahawa Nabi SAW bersabda:

الدُّنْيَا سِجْنُ الْمُؤْمِنِ، وَجَنَّةُ الْكَافِرِ

Maksudnya: “Dunia merupakan penjara bagi orang yang beriman dan syurga bagi orang yang kafir”.

Translated Text:
@XavierNaxa Actually we have been locked up for a long time. From Abu Hurairah RA said, that the Prophet SAW said:

الدُّنْيَا سِجْنُ الْمُؤْمِنِ, وَجَنَّةُ الْكَافِرِ

Meaning: "The world is a prison for believers and paradise for disbelievers".

